INSERT INTO `bm_object` VALUES ('2021-08-10 14:20:22', '2025-03-16 09:11:13', 2, '主桥（钢桁梁悬索桥）', NULL, 'admin', ',1', 1, '0', '', NULL, NULL, NULL, '从工程角度出发，围岩变形破坏主要形式可分为:整体失稳（塌方）、局部失稳（冒顶、片帮）、岩爆、围岩大变形等。', 1, '', '', '', NULL, '');
INSERT INTO `bm_object` VALUES ('2021-08-10 14:48:46', '2025-03-16 09:33:21', 3, '左幅引桥（连续刚构）', NULL, 'admin', ',1', 2, '0', '', NULL, NULL, NULL, '被覆结构在不同压力、地应力、岩体长期强度和工况变化等因素的耦合作用下，发生不同程度的变形破坏，结构变形破坏诱因来源于外部荷载与结构自身。', 1, '', '', '', NULL, '');
INSERT INTO `bm_object` VALUES ('2021-08-10 14:49:19', '2025-03-16 09:33:49', 4, '右幅引桥（连续刚构）', NULL, 'admin', ',1', 3, '0', '', NULL, NULL, NULL, '建筑工程内部环境健康监测系统应满足平战要求，针对平战不同要求分别建立对应的监测指标体系，实现对内部环境的温度、湿度、风速、微生物污染、放射性、有害气体、CO2浓度、O2含量、核辐射、毒气等指标的监测。', 1, '', '', '', NULL, '');
INSERT INTO `bm_object` VALUES ('2021-08-10 14:50:20', '2025-03-16 09:34:15', 5, '左幅引桥（连续T梁）', NULL, 'admin', ',1', 4, '0', '', NULL, NULL, NULL, '建筑工程的内部设备主要集中在通风系统、给排水系统、电力系统、通信系统。', 1, '', '', '', NULL, '');
INSERT INTO `bm_object` VALUES ('2021-08-10 14:50:37', '2025-03-16 09:36:18', 6, '右幅引桥（连续T梁）', NULL, 'admin', ',1', 5, '0', '', NULL, NULL, NULL, '对于KB防护结构，其毁伤判据主要通过结构变形、应力、裂缝、震动等指标评判。', 1, '', '', '', NULL, '');
