INSERT INTO `bm_plan` VALUES ('2021-08-09 16:20:54', '2021-11-01 09:20:13', 1, NULL, 'admin', '内部环境温湿度破坏工程防护技术方案（含图片）', '<p><span style=\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋_GB2312; letter-spacing: -0.4pt;\">当温湿度超过规定范围后，可通过调节空调设备的送风参数、通风量，对内部环境的温湿度进行调节和抢修。当被覆表面出现结露现象，通过独立除湿技术，如固体吸附除湿、液体除湿、转轮除湿等技术，对建筑工程进行除湿。</span></p><p><img src=\"https://www.tientai.com/tthc201811286207/uploadfiles/2019/02/20190223092148837.jpg\" style=\"width: 520px;\"><span style=\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋_GB2312; letter-spacing: -0.4pt;\"><br></span><span style=\"color: rgb(0, 0, 0); font-size: medium;\"></span><br></p>');
INSERT INTO `bm_plan` VALUES ('2021-10-18 18:22:29', '2021-10-18 18:32:44', 2, 'admin', 'admin', '当温湿度超过规定范围后（含超级链接）', '<p><span style=\"color: rgb(0, 0, 0); font-size: 12pt; font-family: 宋体;\">当温湿度超过规定范围后，可通过调节空调设备的送风参数、通风量，对地下空间环境的温湿度进行调节和抢修。</span></p><p><a href=\"https://www.testo.com/zh-CN/products/air-humidity-instrument\" target=\"_blank\">湿度计：可靠地测定关键测量参数</a></p><p><br><span style=\"color: rgb(0, 0, 0); font-size: 12pt; font-family: 宋体;\"><br></span><span style=\"color: rgb(0, 0, 0); font-size: medium;\"></span><br></p>');
INSERT INTO `bm_plan` VALUES ('2021-10-18 18:23:52', '2021-10-18 18:32:31', 3, 'admin', 'admin', '当被覆表面出现结露现象（含视频）', '<p><span style=\"color: rgb(0, 0, 0); font-size: 12pt; font-family: 宋体;\">当被覆表面出现结露现象，通过独立除湿技术，如固体吸附除湿、液体除湿、转轮除湿等技术，对地下空间进行除湿。</span></p><p><span style=\"color: rgb(0, 0, 0); font-size: 12pt; font-family: 宋体;\">同时，采用高效安全的空气消毒剂有重点的对地下空间进行消毒；有条件时，加强地下空间的通风换气；定期清理和更换空调系统的表冷器、加湿器、过滤器等容易滋生细菌的设备；安装紫外线灯，对地下空间空气、水和物体表面进行辐射杀菌。</span></p><p><iframe webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\" frameborder=\"0\" height=\"310\" width=\"500\" src=\"https://v.qq.com/txp/iframe/player.html?vid=s0173fuwtas&amp;amp;auto=0\" class=\"note-video-clip\"></iframe><span style=\"color: rgb(0, 0, 0); font-size: 12pt; font-family: 宋体;\"><br></span><span style=\"color: rgb(0, 0, 0); font-size: medium;\"></span></p>');
INSERT INTO `bm_plan` VALUES ('2021-10-18 18:24:09', '2021-11-01 09:21:03', 4, 'admin', 'admin', '对于放射性污染（氡气体）的抢修方案', '<p><span style=\"color: rgb(0, 0, 0); font-size: 12pt; font-family: 宋体;\">对于放射性污染（氡气体），当氡气体浓度超过安全浓度后，可通过压入式通风降低环境中的氡浓度，利用静电和增加负离子法去除氡子体，以及涂覆防水防氡密封涂料控制氡离子的扩散。</span><span style=\"color: rgb(0, 0, 0); font-size: medium;\"></span><br></p>');
INSERT INTO `bm_plan` VALUES ('2023-04-12 15:16:18', '2023-04-12 15:39:15', 16, 'admin', 'admin', '围岩地灾-块体滑移变形破坏的抢修抢建工程加固方案', '<p class=\"MsoNormal\" style=\"margin: 0cm; text-align: justify; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\"><span style=\"font-family: 宋体;\">块体滑移变形破坏的抢修抢建分为平常条件与极端条件情况。</span><span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm; text-align: justify; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\"><span style=\"font-family: 宋体;\">对于关键块体失稳破坏类型，采取挂网喷射混凝土、喷</span><span lang=\"EN-US\">-</span><span style=\"font-family: 宋体;\">网</span><span lang=\"EN-US\">-</span><span style=\"font-family: 宋体;\">锚联合锚固的系统抢修抢建方案。</span><span lang=\"EN-US\"><o:p></o:p></span></p><h4 style=\"font-family: &quot;等线 Light&quot;; line-height: 18.8pt; color: rgb(0, 0, 0); margin: 6pt 0cm 0cm 22.6pt; font-size: 14pt; text-align: justify; text-indent: -5.65pt; break-after: avoid;\"><span lang=\"EN-US\">（1）<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 仿宋;\">轻度变形破坏的抢修抢建工程加固技术方案</span><span lang=\"EN-US\"><o:p></o:p></span></h4><p class=\"MsoNormal\" style=\"margin: 0cm; text-align: justify; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\"><span style=\"font-family: 宋体;\">轻度变形破坏表现：个别部位衬砌表面裂缝、起壳、渗水等，应根据变形破坏原因进行分析并采用针对性抢修抢建方案。具体原因分为以下几种：（</span><span lang=\"EN-US\">1</span><span style=\"font-family: 宋体;\">）系统支护强度不足；（</span><span lang=\"EN-US\">2</span><span style=\"font-family: 宋体;\">）系统支护老化；（</span><span lang=\"EN-US\">3</span><span style=\"font-family: 宋体;\">）偶发荷载影响；（</span><span lang=\"EN-US\">4</span><span style=\"font-family: 宋体;\">）长期荷载条件变化。具体加固方案如下：</span><span lang=\"EN-US\"><o:p></o:p></span></p><div align=\"center\" style=\"color: rgb(0, 0, 0); font-size: medium;\"><table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border: none;\"><tbody><tr><td style=\"padding: 0cm 5.4pt; border: 1pt solid windowtext;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">变形破坏原因</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td><td style=\"padding: 0cm 5.4pt; border-top: 1pt solid windowtext; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-image: initial; border-left: none;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">加固方案</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td></tr><tr><td style=\"padding: 0cm 5.4pt; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-left: 1pt solid windowtext; border-image: initial; border-top: none;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">系统支护强度不足</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td><td style=\"padding: 0cm 5.4pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">系统补强：局部增设预应力锚固</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td></tr><tr><td style=\"padding: 0cm 5.4pt; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-left: 1pt solid windowtext; border-image: initial; border-top: none;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">系统支护老化</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td><td style=\"padding: 0cm 5.4pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">更换锚固：局部增设预应力锚固</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td></tr><tr><td style=\"padding: 0cm 5.4pt; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-left: 1pt solid windowtext; border-image: initial; border-top: none;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">偶发荷载影响</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td><td style=\"padding: 0cm 5.4pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">局部补强：局部表面喷护</span><span lang=\"EN-US\" style=\"font-family: DengXian;\">+</span><span style=\"font-family: &quot;等线 Light&quot;;\">锚杆</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td></tr><tr><td style=\"padding: 0cm 5.4pt; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-left: 1pt solid windowtext; border-image: initial; border-top: none;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">长期荷载条件变化</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td><td style=\"padding: 0cm 5.4pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">系统补强：局部表面喷护</span><span lang=\"EN-US\" style=\"font-family: DengXian;\">+</span><span style=\"font-family: &quot;等线 Light&quot;;\">挂网</span><span lang=\"EN-US\" style=\"font-family: DengXian;\">+</span><span style=\"font-family: &quot;等线 Light&quot;;\">锚固</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td></tr></tbody></table></div><p class=\"MsoNormal\" style=\"margin: 0cm; text-indent: 0cm; text-align: justify; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\"><span lang=\"EN-US\">&nbsp;</span></p><h4 style=\"font-family: &quot;等线 Light&quot;; line-height: 18.8pt; color: rgb(0, 0, 0); margin: 6pt 0cm 0cm 22.6pt; font-size: 14pt; text-align: justify; text-indent: -5.65pt; break-after: avoid;\"><span lang=\"EN-US\">（2）<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family: 仿宋;\">中度变形破坏的抢修抢建工程加固技术方案</span><span lang=\"EN-US\"><o:p></o:p></span></h4><p class=\"MsoNormal\" style=\"margin: 0cm; text-align: justify; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\"><span style=\"font-family: 宋体;\">当轻度变形破坏期错失加固时机或偶发破坏性荷载导致硐室围岩出现衬砌表面裂缝、起壳、渗水或个别部位掉块时，应采用如下加固如下：</span><span lang=\"EN-US\"><o:p></o:p></span></p><div align=\"center\" style=\"color: rgb(0, 0, 0); font-size: medium;\"><table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border: none;\"><tbody><tr><td style=\"padding: 0cm 5.4pt; border: 1pt solid windowtext;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">变形破坏原因</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td><td style=\"padding: 0cm 5.4pt; border-top: 1pt solid windowtext; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-image: initial; border-left: none;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">加固方案</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td></tr><tr><td style=\"padding: 0cm 5.4pt; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-left: 1pt solid windowtext; border-image: initial; border-top: none;\"><p class=\"a\" style=\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;等线 Light&quot;;\">系统支护强度不足</span><span lang=\"EN-US\" style=\"font-family: DengXian;\"><o:p></o:p></span></p></td><td style=\"padding: 0cm 5.4pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext;\"><p class=\"a\" style