INSERT INTO `sys_oper_log` VALUES (211, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"块体滑移变形破坏的抢修抢建工程加固方案\"],\"content\":[\"<p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 宋体;\\\">块体滑移变形破坏的抢修抢建分为平常条件与极端条件情况。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 宋体;\\\">对于关键块体失稳破坏类型，采取挂网喷射混凝土、喷</span><span lang=\\\"EN-US\\\">-</span><span style=\\\"font-family: 宋体;\\\">网</span><span lang=\\\"EN-US\\\">-</span><span style=\\\"font-family: 宋体;\\\">锚联合锚固的系统抢修抢建方案。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><h4 style=\\\"font-family: &quot;等线 Light&quot;; line-height: 18.8pt; color: rgb(0, 0, 0); margin: 6pt 0cm 0cm 22.6pt; font-size: 14pt; text-align: justify; text-indent: -5.65pt; break-after: avoid;\\\"><span lang=\\\"EN-US\\\">（1）<span style=\\\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\\\">&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\\\"font-family: 仿宋;\\\">轻度变形破坏的抢修抢建工程加固技术方案</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h4><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 宋体;\\\">轻度变形破坏表现：个别部位衬砌表面裂缝、起壳、渗水等，应根据变形破坏原因进行分析并采用针对性抢修抢建方案。具体原因分为以下几种：（</span><span lang=\\\"EN-US\\\">1</span><span style=\\\"font-family: 宋体;\\\">）系统支护强度不足；（</span><span lang=\\\"EN-US\\\">2</span><span style=\\\"font-family: 宋体;\\\">）系统支护老化；（</span><span lang=\\\"EN-US\\\">3</span><span s', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:16:17', NULL);
INSERT INTO `sys_oper_log` VALUES (212, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"第2种围岩变形破坏的抢修抢建工程加固技术方案\"],\"content\":[\"<h4 style=\\\"font-family: &quot;等线 Light&quot;; line-height: 18.8pt; color: rgb(0, 0, 0); margin: 6pt 0cm 0cm 22.6pt; font-size: 14pt; text-align: justify; text-indent: -5.65pt; break-after: avoid;\\\"><span lang=\\\"EN-US\\\">（1）<span style=\\\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\\\">&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\\\"font-family: 仿宋;\\\">轻度变形破坏的抢修抢建工程加固技术方案</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h4><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 宋体;\\\">轻度变形破坏表现：个别部位衬砌表面裂缝、起壳、渗水等，应根据变形破坏原因进行分析并采用针对性抢修抢建方案。具体原因分为以下几种：（</span><span lang=\\\"EN-US\\\">1</span><span style=\\\"font-family: 宋体;\\\">）系统支护强度不足；（</span><span lang=\\\"EN-US\\\">2</span><span style=\\\"font-family: 宋体;\\\">）系统支护老化；（</span><span lang=\\\"EN-US\\\">3</span><span style=\\\"font-family: 宋体;\\\">）偶发荷载影响；（</span><span lang=\\\"EN-US\\\">4</span><span style=\\\"font-family: 宋体;\\\">）长期荷载条件变化。具体加固方案如下：</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><div align=\\\"center\\\" style=\\\"color: rgb(0, 0, 0); font-size: medium;\\\"><table class=\\\"MsoTableGrid\\\" border=\\\"1\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" style=\\\"border: none;\\\"><tbody><tr><td style=\\\"padding: 0cm 5.4pt; border: 1pt solid windowtext;\\\"><p class=\\\"a\\\" style=\\\"margin: 0cm; text-align: center; font-size: 9pt; font-family: &quot;Times New Roman&quot;, serif;\\\"><span style=\\\"font-family: &quot;等线 Light&quot;;\\\">变形破坏原因</span><span lang=\\\"EN-US\\\" style=\\\"font-family: DengXian;\\\"><o:p></o:p></span></p></td><td style=\\\"padding: 0cm 5.4pt; border-top: 1pt solid windowt', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:19:24', NULL);
INSERT INTO `sys_oper_log` VALUES (213, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"边坡抢修抢建方案\"],\"content\":[\"<h3 style=\\\"margin: 6pt 0cm 0cm 16.95pt; text-align: justify; text-indent: 0cm; line-height: 23.3333px; break-after: avoid; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span lang=\\\"EN-US\\\">1.1.1<span style=\\\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\\\"font-family: 宋体;\\\">边坡加固响应预案选择</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h3><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 宋体;\\\">根据当前边坡损伤状态的“健全、轻度损伤、中度损伤、重度损伤”四类特征及维修紧迫性</span><span lang=\\\"EN-US\\\">“</span><span style=\\\"font-family: 宋体;\\\">立即抢修</span><span lang=\\\"EN-US\\\">”“</span><span style=\\\"font-family: 宋体;\\\">尽快维修</span><span lang=\\\"EN-US\\\">”“</span><span style=\\\"font-family: 宋体;\\\">加强监测</span><span lang=\\\"EN-US\\\">,</span><span style=\\\"font-family: 宋体;\\\">必要时维修</span><span lang=\\\"EN-US\\\">,”“</span><span style=\\\"font-family: 宋体;\\\">加强检查、正常维修</span><span lang=\\\"EN-US\\\">”“</span><span style=\\\"font-family: 宋体;\\\">正常维护</span><span lang=\\\"EN-US\\\">”</span><span style=\\\"font-family: 宋体;\\\">五级排序匹配加固技术方案。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" align=\\\"center\\\" style=\\\"margin: 0cm; text-align: center; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 宋体;\\\">表</span><span lang=\\\"EN-US\\\">2.12 </span><span style=\\\"font-family: 宋体;\\\">加固响应选择对照表</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><tabl', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:21:19', NULL);
INSERT INTO `sys_oper_log` VALUES (214, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"被覆结构变形抢修抢建技术\"],\"content\":[\"<p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">破坏表现：被覆结构变形过大、局部稳定性破坏、失稳破坏；</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">破坏原因：极端荷载、地应力、材料性能失效等；</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">加固方案：被覆结构变形破坏可采用嵌拱及钢带加固和套拱加固，局部失稳和整体失稳破坏采用围岩变形破坏的抢修抢建工程加固技术方案。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">（</span><span lang=\\\"EN-US\\\">a</span><span style=\\\"font-family: 仿宋;\\\">）嵌拱及钢带加固，被覆结构衬砌裂缝较严重、但结构尚有较强承载能力时，可通过嵌拱（轨）、钢带以及网片加喷射（钢纤维）混凝土的方法对结构进行加固。嵌拱（轨）法和钢带加固法通过在衬砌结构内环向支撑（或凿槽埋设）钢带、钢拱架或钢轨，从而使衬砌结构得到有效的支撑。嵌拱（轨）加固可根据实际需要直接在衬砌外施作，也可以在原衬砌内凿槽安装，具体施作方式可根据紧急程度、加固目的、建筑限界因素综合选定。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p><span style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋;\\\">（</span><span lang=\\\"EN-US\\\" style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif;\\\">b</span><span style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋;\\\">）套拱加固技术，被覆结构净空允许且衬砌结构存在一定的承载能力时，在既有衬砌外重新施作套拱结构，新施作结构与原结构形成一体共同承担围岩压力，在充分利用原有结构承载力基础上，保证结构安全。套拱可通过模筑混凝土施工，也可用喷射（钢纤维、碳纤维）混凝土方式施作，喷射混凝土添加钢纤维和碳纤维可有效增强结构承载能力，减少套拱结构厚度。</span><span style=\\\"color: rgb(0, 0, 0); font-', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:23:47', NULL);
INSERT INTO `sys_oper_log` VALUES (215, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"被覆结构劣化抢修抢建技术\"],\"content\":[\"<p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">破坏表现：支护结构的强度降低、混凝土碳化、钢筋锈蚀、钢筋脆化、疲劳、应力损失、钢筋与混凝土之间粘结锚固作用削弱；</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">破坏原因：极端荷载、材料性能失效等；</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p><span style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋;\\\">加固方案：在原有结构已失去承载能力或结构净空不允许时，可采用钢带、嵌拱等方法提供其支护能力。更为严重的情况时候，需将原有衬砌结构拆除并更换。与衬砌套拱类似，衬砌更换可分为整体全换和局部结构更换。新材料、新技术和新工艺，如喷射碳（钢）纤维混凝土加网片、粘碳（芳纶）纤维板（布）法、粘钢板法等方法也可用于加固处理。</span><span style=\\\"color: rgb(0, 0, 0); font-size: medium;\\\"></span><br></p>\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:24:23', NULL);
INSERT INTO `sys_oper_log` VALUES (216, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"被覆结构裂缝、渗漏水和表层破坏抢修抢建技术\"],\"content\":[\"<p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">加固方案：根据裂缝产生的原因选择加固方法：如针对非结构性裂缝，不影响整体的力学性能，可采取提高构建观感质量和耐久性修补；对于结构性裂缝，由于其不断发展会危及结构安全，要采取加固方法。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">非结构性裂缝可采用封堵和表面处理的方法，裂缝宽度在</span><span lang=\\\"EN-US\\\">0.2~1mm</span><span style=\\\"font-family: 仿宋;\\\">时，需用高强度密封砂浆将裂缝表面封闭，以防止裂缝内钢筋氧化，同时起缝合作用，并防止裂缝进一步发展；裂缝宽度大于１ｍｍ时，用注射等方法将环氧树脂和高强度胶填充裂缝，且采用表面封堵法，即在开裂的混凝土表面涂刷水泥浆、油漆、沥青、环氧树脂等液体材料，多层涂刷，利用液体的毛细吸力堵塞裂缝，减少渗漏、防止钢筋锈蚀。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p><span style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋;\\\">结构性裂缝加固方法有：加大截面法、外包钢筋加固法、预应力加固法、增加支点加固法、粘钢或碳纤维加固法及多种方法的联合使用。在使用过程中在综合结构特征、裂缝严重程度、施工适用性、施工周期等因素确定。加固后的整体效果取决于新老混凝土结合面能否有效结合，加固过程中药提高二者的结合性能。</span><span style=\\\"color: rgb(0, 0, 0); font-size: medium;\\\"></span><br></p>\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:25:29', NULL);
INSERT INTO `sys_oper_log` VALUES (217, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"热环境破坏抢修抢建技术\"],\"content\":[\"<h4 style=\\\"margin: 0cm; text-indent: 28pt; line-height: 28pt; break-after: avoid; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; font-weight: normal; color: rgb(0, 0, 0);\\\"><span lang=\\\"EN-US\\\">1） </span><span style=\\\"font-family: 仿宋;\\\">温度过高或者过低</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h4><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">增加或者减少通风系统的通风量，或者调整送风温度，从而满足温度要求。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><h4 style=\\\"margin: 0cm; text-indent: 28pt; line-height: 28pt; break-after: avoid; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; font-weight: normal; color: rgb(0, 0, 0);\\\"><span lang=\\\"EN-US\\\">2） </span><span style=\\\"font-family: 仿宋;\\\">相对湿度过高</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h4><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">增加通风系统的通风量，或者增加独立除湿设备。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p>\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:28:29', NULL);
INSERT INTO `sys_oper_log` VALUES (218, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"风环境破坏抢修抢建技术\"],\"content\":[\"<h4 style=\\\"margin: 0cm; text-indent: 28pt; line-height: 28pt; break-after: avoid; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; font-weight: normal; color: rgb(0, 0, 0);\\\"><span lang=\\\"EN-US\\\">1） </span><span style=\\\"font-family: 仿宋;\\\">风速过高或者过低</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h4><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">增加或者减少通风系统的通风量。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><h4 style=\\\"margin: 0cm; text-indent: 28pt; line-height: 28pt; break-after: avoid; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; font-weight: normal; color: rgb(0, 0, 0);\\\"><span lang=\\\"EN-US\\\">2） </span><span style=\\\"font-family: 仿宋;\\\">气压过大</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h4><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">减少通风系统的通风量，或者增加排风量。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><h4 style=\\\"margin: 0cm; text-indent: 28pt; line-height: 28pt; break-after: avoid; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; font-weight: normal; color: rgb(0, 0, 0);\\\"><span lang=\\\"EN-US\\\">3） </span><span style=\\\"font-family: 仿宋;\\\">气压过小</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h4><p><span style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋;\\\">增加通风系统的通风量，或者减少排风量。</span><span style=\\\"color: rgb(0, 0, 0); font-size: medium;\\\"></span><br></p>\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:29:12', NULL);
INSERT INTO `sys_oper_log` VALUES (219, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"空气质量破坏抢修抢建技术\"],\"content\":[\"<h4 style=\\\"margin: 0cm; text-indent: 28pt; line-height: 28pt; break-after: avoid; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; font-weight: normal; color: rgb(0, 0, 0);\\\"><span lang=\\\"EN-US\\\">1） </span><span style=\\\"font-family: 仿宋;\\\">有害气体浓度超标</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h4><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">增加通风系统的通风量，或更换通风方式，或使用空气净化设备。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><h4 style=\\\"margin: 0cm; text-indent: 28pt; line-height: 28pt; break-after: avoid; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; font-weight: normal; color: rgb(0, 0, 0);\\\"><span lang=\\\"EN-US\\\">2） </span><span style=\\\"font-family: 仿宋;\\\">出现有毒气体</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h4><p><span style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋;\\\">切换</span><span lang=\\\"EN-US\\\" style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif;\\\">GJ</span><span style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋;\\\">通风。</span><span style=\\\"color: rgb(0, 0, 0); font-size: medium;\\\"></span><br></p>\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:29:47', NULL);
INSERT INTO `sys_oper_log` VALUES (220, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"环境辐射污染抢修抢建技术\"],\"content\":[\"<h4 style=\\\"margin: 0cm; text-indent: 28pt; line-height: 28pt; break-after: avoid; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; font-weight: normal; color: rgb(0, 0, 0);\\\"><span lang=\\\"EN-US\\\">1） </span><span style=\\\"font-family: 仿宋;\\\">氡气浓度超标</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h4><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">增加通风系统的通风量，或使用空气净化设备。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p>\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:30:54', NULL);
INSERT INTO `sys_oper_log` VALUES (221, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"KB抢修抢建技术\"],\"content\":[\"<p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 22.4pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-size: 12pt; font-family: 宋体; letter-spacing: -0.4pt;\\\">建立动载冲击波作用下建筑工程</span><span lang=\\\"EN-US\\\" style=\\\"font-size: 12pt; letter-spacing: -0.4pt;\\\">KB</span><span style=\\\"font-size: 12pt; font-family: 宋体; letter-spacing: -0.4pt;\\\">安全状态评估方法，评估</span><span lang=\\\"EN-US\\\" style=\\\"font-size: 12pt; letter-spacing: -0.4pt;\\\">KB</span><span style=\\\"font-size: 12pt; font-family: 宋体; letter-spacing: -0.4pt;\\\">安全状态；基于</span><span lang=\\\"EN-US\\\" style=\\\"font-size: 12pt; letter-spacing: -0.4pt;\\\">KB</span><span style=\\\"font-size: 12pt; font-family: 宋体; letter-spacing: -0.4pt;\\\">毁伤数据库，研究工程内部抢修抢建工程加固技术，提出适用于不同毁伤工况的抢修抢建工程加固技术方法体系，形成抢修抢建工程加固技术方案库。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p>\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:32:28', NULL);
INSERT INTO `sys_oper_log` VALUES (222, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"通风系统抢修抢建技术\"],\"content\":[\"<p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28.1pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><b><span lang=\\\"EN-US\\\">1</span></b><b><span style=\\\"font-family: 仿宋;\\\">）风管风量不足</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></b></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">使用多台风机，或者增加风机功率，使其满足风量需求。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28.1pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><b><span lang=\\\"EN-US\\\">2</span></b><b><span style=\\\"font-family: 仿宋;\\\">）风机疲劳损伤</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></b></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">暂停该风机运行选用备用风机运行。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28.1pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><b><span lang=\\\"EN-US\\\">3</span></b><b><span style=\\\"font-family: 仿宋;\\\">）风管裂缝</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></b></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">用胶带处理。先用防水胶带（又称防水纸）在裂缝的风管外面包好几层，然后用泡沫胶包好，再包在外面，再包在泡沫胶外面的防水纸上，再包在防水纸外面的泡沫纸上。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; ', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:33:46', NULL);
INSERT INTO `sys_oper_log` VALUES (223, '抢修抢建方案', 1, 'edu.whut.cs.bm.biz.controller.PlanController.addSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/add', '192.168.1.100', '内网IP', '{\"title\":[\"给排水系统抢修抢建技术\"],\"content\":[\"<p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28.1pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><b><span lang=\\\"EN-US\\\">1</span></b><b><span style=\\\"font-family: 仿宋;\\\">）水管渗、漏、滴</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></b></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">用防水胶带处理。先用防水胶带（又称防水纸）在漏水的水管外面包好几层，然后用泡沫胶包好，再包在外面，再包在泡沫胶外面的防水纸上，再包在防水纸外面的泡沫纸上。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28.1pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><b><span lang=\\\"EN-US\\\">2</span></b><b><span style=\\\"font-family: 仿宋;\\\">）水泵疲劳损伤</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></b></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">更换备用水泵。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28.1pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><b><span lang=\\\"EN-US\\\">3</span></b><b><span style=\\\"font-family: 仿宋;\\\">）水泵振动损伤</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></b></p><p><span style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋;\\\">更换备用水泵。</span><span style=\\\"color: rgb(0, 0, 0); font-size: medium;\\\"></span><br></p>\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:34:25', NULL);
