=\\\"font-family: 宋体;\\\">轻度变形破坏表现：个别部位衬砌表面裂缝、起壳、渗水等，应根据变形破坏原因进行分析并采用针对性抢修抢建方案。具体原因分为以下几种：（</span><span lang=\\\"EN-US\\\">1</span><span style=\\\"font-family: 宋体;\\\">）系统支护强度不足；（</span><span lang=\\\"EN-US\\\">2</span><span style=\\\"font-family: 宋体;\\\">）系统支护老化；（</span><span lang=\\\"EN-US\\', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:39:15', NULL);
INSERT INTO `sys_oper_log` VALUES (230, '抢修抢建方案', 2, 'edu.whut.cs.bm.biz.controller.PlanController.editSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/edit', '192.168.1.100', '内网IP', '{\"id\":[\"17\"],\"title\":[\"围岩地灾-第2种围岩变形破坏的抢修抢建工程加固技术方案\"],\"content\":[\"<h4 style=\\\"font-family: &quot;等线 Light&quot;; line-height: 18.8pt; color: rgb(0, 0, 0); margin: 6pt 0cm 0cm 22.6pt; font-size: 14pt; text-align: justify; text-indent: -5.65pt; break-after: avoid;\\\"><span lang=\\\"EN-US\\\">（1）<span style=\\\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\\\">&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\\\"font-family: 仿宋;\\\">轻度变形破坏的抢修抢建工程加固技术方案</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h4><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 宋体;\\\">轻度变形破坏表现：个别部位衬砌表面裂缝、起壳、渗水等，应根据变形破坏原因进行分析并采用针对性抢修抢建方案。具体原因分为以下几种：（</span><span lang=\\\"EN-US\\\">1</span><span style=\\\"font-family: 宋体;\\\">）系统支护强度不足；（</span><span lang=\\\"EN-US\\\">2</span><span style=\\\"font-family: 宋体;\\\">）系统支护老化；（</span><span lang=\\\"EN-US\\\">3</span><span style=\\\"font-family: 宋体;\\\">）偶发荷载影响；（</span><span lang=\\\"EN-US\\\">4</span><span style=\\\"font-family: 宋体;\\\">）长期荷载条件变化。具体加固方案如下：</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><div align=\\\"center\\\" style=\\\"color: rgb(0, 0, 0); font-size: medium;\\\"><table class=\\\"MsoTableGrid\\\" border=\\\"1\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" style=\\\"border: none;\\\"><tbody><tr><td style=\\\"padding: 0cm 5.4pt; border: 1pt solid windowtext;\\\"><p class=\\\"a\\\