INSERT INTO `sys_oper_log` VALUES (231, '抢修抢建方案', 2, 'edu.whut.cs.bm.biz.controller.PlanController.editSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/edit', '192.168.1.100', '内网IP', '{\"id\":[\"18\"],\"title\":[\"围岩地灾-边坡抢修抢建方案\"],\"content\":[\"<h3 style=\\\"margin: 6pt 0cm 0cm 16.95pt; text-align: justify; text-indent: 0cm; line-height: 23.3333px; break-after: avoid; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span lang=\\\"EN-US\\\">1.1.1<span style=\\\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\\\"font-family: 宋体;\\\">边坡加固响应预案选择</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></h3><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 宋体;\\\">根据当前边坡损伤状态的“健全、轻度损伤、中度损伤、重度损伤”四类特征及维修紧迫性</span><span lang=\\\"EN-US\\\">“</span><span style=\\\"font-family: 宋体;\\\">立即抢修</span><span lang=\\\"EN-US\\\">”“</span><span style=\\\"font-family: 宋体;\\\">尽快维修</span><span lang=\\\"EN-US\\\">”“</span><span style=\\\"font-family: 宋体;\\\">加强监测</span><span lang=\\\"EN-US\\\">,</span><span style=\\\"font-family: 宋体;\\\">必要时维修</span><span lang=\\\"EN-US\\\">,”“</span><span style=\\\"font-family: 宋体;\\\">加强检查、正常维修</span><span lang=\\\"EN-US\\\">”“</span><span style=\\\"font-family: 宋体;\\\">正常维护</span><span lang=\\\"EN-US\\\">”</span><span style=\\\"font-family: 宋体;\\\">五级排序匹配加固技术方案。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" align=\\\"center\\\" style=\\\"margin: 0cm; text-align: center; text-indent: 24pt; line-height: 20px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 宋体;\\\">表</span><span lang=\\\"EN-US\\\">2.12 </span><span style=\\\"font-family: 宋体;\\\">加固响应选择对照表</span><span lang=\\\"EN-US\\\"><o:p></o:p', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:39:39', NULL);
INSERT INTO `sys_oper_log` VALUES (232, '抢修抢建方案', 2, 'edu.whut.cs.bm.biz.controller.PlanController.editSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/edit', '192.168.1.100', '内网IP', '{\"id\":[\"19\"],\"title\":[\"被覆结构-变形抢修抢建技术\"],\"content\":[\"<p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">破坏表现：被覆结构变形过大、局部稳定性破坏、失稳破坏；</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">破坏原因：极端荷载、地应力、材料性能失效等；</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">加固方案：被覆结构变形破坏可采用嵌拱及钢带加固和套拱加固，局部失稳和整体失稳破坏采用围岩变形破坏的抢修抢建工程加固技术方案。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">（</span><span lang=\\\"EN-US\\\">a</span><span style=\\\"font-family: 仿宋;\\\">）嵌拱及钢带加固，被覆结构衬砌裂缝较严重、但结构尚有较强承载能力时，可通过嵌拱（轨）、钢带以及网片加喷射（钢纤维）混凝土的方法对结构进行加固。嵌拱（轨）法和钢带加固法通过在衬砌结构内环向支撑（或凿槽埋设）钢带、钢拱架或钢轨，从而使衬砌结构得到有效的支撑。嵌拱（轨）加固可根据实际需要直接在衬砌外施作，也可以在原衬砌内凿槽安装，具体施作方式可根据紧急程度、加固目的、建筑限界因素综合选定。</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p><span style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋;\\\">（</span><span lang=\\\"EN-US\\\" style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif;\\\">b</span><span style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋;\\\">）套拱加固技术，被覆结构净空允许且衬砌结构存在一定的承载能力时，在既有衬砌外重新施作套拱结构，新施作结构与原结构形成一体共同承担围岩压力，在充分利用原有结构承载力基础上，保证结构安全。套拱可通过模筑混凝土施工，也可用喷射（钢纤维、碳纤维）混凝土方式施作，喷射混凝土添加钢纤维和碳纤维可有效增强结构承载能力，减少套拱结构厚度。</span><span style=\\\"color: rgb(0,', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:39:54', NULL);
INSERT INTO `sys_oper_log` VALUES (233, '抢修抢建方案', 2, 'edu.whut.cs.bm.biz.controller.PlanController.editSave()', 'POST', 1, 'admin', '研发部门', '/biz/plan/edit', '192.168.1.100', '内网IP', '{\"id\":[\"20\"],\"title\":[\"被覆结构 - 劣化抢修抢建技术\"],\"content\":[\"<p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">破坏表现：支护结构的强度降低、混凝土碳化、钢筋锈蚀、钢筋脆化、疲劳、应力损失、钢筋与混凝土之间粘结锚固作用削弱；</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p class=\\\"MsoNormal\\\" style=\\\"margin: 0cm; text-align: justify; text-indent: 28pt; line-height: 28pt; font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif; color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: 仿宋;\\\">破坏原因：极端荷载、材料性能失效等；</span><span lang=\\\"EN-US\\\"><o:p></o:p></span></p><p><span style=\\\"color: rgb(0, 0, 0); font-size: 14pt; font-family: 仿宋;\\\">加固方案：在原有结构已失去承载能力或结构净空不允许时，可采用钢带、嵌拱等方法提供其支护能力。更为严重的情况时候，需将原有衬砌结构拆除并更换。与衬砌套拱类似，衬砌更换可分为整体全换和局部结构更换。新材料、新技术和新工艺，如喷射碳（钢）纤维混凝土加网片、粘碳（芳纶）纤维板（布）法、粘钢板法等方法也可用于加固处理。</span><span style=\\\"color: rgb(0, 0, 0); font-size: medium;\\\"></span><br></p>\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2023-04-12 15:40:10', NULL);
